import React, {Component} from "react";
import './App.css';
import Header from './Components/Header.jsx';
import HeaderCatalogo from './Components/HeaderCatalogo.jsx';
import Propiedad from './Components/Propiedad.jsx';

function App() {

  const propiedades=['French 401', 
  'Pellegrini 635',
  'Viraro 170',
  'Av. Sarmiento 635',
  'Jujuy 514',
  'Las Heras 741',
  'José Hernandes 963',
  'Hernandarias 526',
  'Av Velez Sarfield 749']
  return (
      <>
    <Header/>
      {/* <HeaderCatalogo/> */}
    <div className="col-12 p-5 row gap-4">
    {propiedades.map(propiedad=>(

              <Propiedad direccion={propiedad}/>

            ))}
      </div>

    </>
    );
}

export default App;
